import { ADD_TWEET } from '../actions/actions'

const initialState = {
    tweets: []
}

export default function tweetsReducer(state = initialState, action) {
    switch (action.type) {
        case ADD_TWEET:
            const { payload } = action.payload;
            console.log(payload);
            console.log()
            return { ...state, payload };
        default:
            return state;
    }
}
